import{_}from"./plugin-vue_export-helper-c27b6911.js";import{o as p,c as e,e as t}from"./app-f1e7afee.js";const o={},c=t("<p>《三命通会》卷 八·六乙日丁丑时断（以下六乙日所忌月分与上同，时亦并论）</p><p>六乙日生时丁丑，食神相助遇财官；</p><p>月通金气化为福，不是寻常下贱看。</p><p>乙日丁丑时，食会财官，丁为食，庚为官，己为财，丑中有辛金合局，己土得位，如有倚托者，贵。</p><p>通金气月化者，富厚尊重；不通月气，平常。</p><p>乙丑日丁丑时，秋生有权；主带疾；夏吉，冬平；春旺，贵寿。</p><p>乙卯日丁丑时，亥月，身旺见辛偏官，柱有丁制，风宪武职。</p><p>乙巳日丁丑时生，亥卯未寅月，贵。</p><p>通金气月有倚托者，福重。</p><p>乙未日丁丑时，辰戌丑未月，富。</p><p>春寿长，秋名利，夏贫下，冬平常，申年月，武职三品。</p><p>乙酉日丁丑时，若通木气有倚托者，显贵。</p><p>申丑年月亦好，寅亥尤佳。</p><p>乙亥日丁丑时，亥月，性急有操持，妻贤子孝，官至六七品。</p><p>午月长生，年月透官印，大贵。</p><p>仓库时开乙见丁，食神坐库禄财亲。</p><p>无匙不作朝中客，也是清闲有福人。</p><p>乙日时逢丁丑，寿星发达无疑，身居磨蝎莫嫌迟，库内钱财积聚。</p><p>年时月合发达，空刑妻子难为。</p><p>双亲雁侣有盈亏，运至牢藏金柜。</p>",20),r=[c];function s(n,a){return p(),e("div",null,r)}const f=_(o,[["render",s],["__file","181卷 八·六乙日丁丑时断（以下六乙日所忌月分与上同，时亦并论）.html.vue"]]);export{f as default};
